(488, 1, '综合', '6St6dnV4', '2016-01-06 18:45:13', '第一象 甲子 乾下乾上 乾\r\n谶曰：\r\n第一象\r\n第一象\r\n\r\n　　茫茫天地，不知所止；\r\n日月循环，周而复始。\r\n颂曰：\r\n　　自从盘古迄希夷，虎斗龙争事正奇；\r\n悟得循环真谛在，试于唐后论元机。\r\n金圣叹曰：此象主古今治乱相因，如日月往来，阴阳递嬗，即孔子百世可知之意。红者为日，白者为月，有日月而后昼夜成；有昼夜而后寒暑判；有寒暑而后历数定；有历数而后统系分；有统系而后兴亡见矣。\r\n\r\n						', NULL, NULL, 0),
